import React, { useContext, useEffect } from 'react'
import noteContext from '../context/notes/notesContext'

const About = () => {
    const a = useContext(noteContext)
    useEffect(() => {
        a.update()
    }, [])
    return (
        <div>
            About Page "{a.state.name}" and his class is "{a.satateclass}"
        </div>
    )
}

export default About
